    const [addNewNotes,setAddNewNotes]=useState()
    function addNote(note){
        console.log(note);
    }
    return(
        <>
        <Header/>
        <CreateArea
            onAdd={addNote}
        />
        <Note
            key={1}
            title="Note title"
            content = "Note content"
        />
        
        <Footer/>
        </>
    );
}
export default App;
